})

const Mapbox = props => {

return (
<div>
  <Map
  style="mapbox://styles/mapbox/streets-v9"
  containerStyle={{
    height: "100vh",
    width: "100vw"
  }}>
    <Layer
    type="symbol"
    id="marker"
    layout={{ "icon-image": "marker-15" }}>
    <Feature coordinates={[-0.481747846041145, 51.3233379650232]}/>
    </Layer>
  </Map>

  <GeoJSONLayer
  data={geojson}
  symbolLayout={{
    "text-field": "{place}",
    "text-font": ["Open Sans Semibold", "Arial Unicode MS Bold"],
    "text-offset": [0, 0.6],
    "text-anchor": "top"
  }}/>
  </div>
)


}

export default Mapbox
